import React from 'react';
import './Country.css';
import { Link } from 'react-router-dom';


export function Country () {
    let flag = "https://restcountries.eu/data/col.svg";
    let name = 'Colombia';
    let capital='Bogota';
    let continent='America del Sur'

    return (

        <div className='countryCard'>
            <Link to='/Country'>
            <img className='img' src= {flag} /></Link>
            <div className="countryBody">
              <div className='list' >
              <p>Nombre :</p>
              <p>{name}</p>
              </div>
              <div >
              <p>Capital :</p>
              <p>{capital}</p>
              </div>
              <div >
              <p>Continente :</p>
              <p>{continent}</p>
              </div>
            </div>
        </div>

    )
};

export default Country;
